import { fonts } from '../styles';

export default function Index() {
  return (
    <div>
      <h1>Hello Next Website</h1>
      <style>{`
        h1 {
          font-family: ${fonts.serif};
          font-weight: 600;
          margin: 0;
        }
      `}</style>
      <style global jsx>{`
        ${fonts.import}

        * {
          box-sizing: border-box;
        }

        body, h1, h2, h3, h4, h5, h6, p, ul, ol {
          margin: 0;
          padding: 0;
        }
      `}</style>
    </div>
  )
}
